import React, { useState } from "react";
import { Card, CardContent } from "@/components/ui/card";
import { FaChartLine, FaMobileAlt, FaShieldAlt, FaMoneyBillWave, FaClipboardList, FaRobot, FaLightbulb, FaChartBar } from "react-icons/fa";

const appsData = [
  {
    name: "Kite",
    description: "A sleek and powerful trading platform with advanced charting and analysis tools.",
    icon: <FaChartLine className="text-blue-500 text-3xl" />,
  },
  {
    name: "Coin",
    description: "Invest in direct mutual funds with zero commission.",
    icon: <FaMobileAlt className="text-green-500 text-3xl" />,
  },
  {
    name: "Console",
    description: "The central dashboard for your Zerodha account, providing reports and insights.",
    icon: <FaShieldAlt className="text-yellow-500 text-3xl" />,
  },
  {
    name: "Varsity",
    description: "A free and comprehensive stock market education platform by Zerodha.",
    icon: <FaClipboardList className="text-purple-500 text-3xl" />,
  },
  {
    name: "GoldenPi",
    description: "Invest in bonds and debentures directly from the Zerodha platform.",
    icon: <FaMoneyBillWave className="text-red-500 text-3xl" />,
  },
  {
    name: "Streak",
    description: "Algo trading without coding. Backtest and deploy strategies easily.",
    icon: <FaRobot className="text-orange-500 text-3xl" />,
  },
  {
    name: "Sensibull",
    description: "Options trading strategies and analysis.",
    icon: <FaChartBar className="text-indigo-500 text-3xl" />,
  },
  {
    name: "Smallcase",
    description: "Thematic investment portfolios to diversify investments.",
    icon: <FaLightbulb className="text-teal-500 text-3xl" />,
  }
];

const faqs = [
  {
    question: "What is Zerodha?",
    answer: "Zerodha is India's largest stock brokerage firm, offering low-cost trading solutions."
  },
  {
    question: "How do I open an account?",
    answer: "You can open an account online by submitting your KYC documents and completing verification."
  },
  {
    question: "What are the charges for trading?",
    answer: "Zerodha offers zero brokerage for equity investments and Rs. 20 per executed order for intraday and F&O trades."
  },
  {
    question: "Is my money safe with Zerodha?",
    answer: "Yes, Zerodha is a registered broker with SEBI and follows all regulatory compliance norms."
  }
];

const tradingTips = [
  "Always do your research before investing in a stock.",
  "Diversify your portfolio to reduce risk.",
  "Don't invest based on emotions; follow a strategy.",
  "Understand the basics of fundamental and technical analysis.",
  "Start with small investments and gradually increase as you gain confidence."
];

const stockMarketBasics = [
  "Stock Market: A marketplace where stocks are bought and sold.",
  "Stocks: Shares of a company that represent ownership.",
  "IPO (Initial Public Offering): The first sale of stock by a company to the public.",
  "Bull & Bear Market: A bull market means prices are rising, and a bear market means prices are falling.",
  "Fundamental Analysis: Evaluating a company based on its financial statements, management, and industry trends.",
  "Technical Analysis: Analyzing price charts and trading volumes to predict future stock movements.",
  "Liquidity: The ease with which a stock can be bought or sold in the market.",
  "Market Orders vs. Limit Orders: Market orders execute at the current price, while limit orders execute at a set price."
];

const Apps = () => {
  const [activeFaq, setActiveFaq] = useState(null);

  return (
    <div className="p-6">
      <h1 className="text-4xl font-bold text-center mb-6">Zerodha Apps & Tools</h1>
      <p className="text-center text-gray-600 mb-4">Explore various apps and platforms offered by Zerodha to enhance your trading and investment experience.</p>
      <div className="grid md:grid-cols-3 gap-6">
        {appsData.map((app, index) => (
          <Card key={index} className="p-4 shadow-lg rounded-xl hover:shadow-xl transition">
            <CardContent className="flex flex-col items-center text-center">
              {app.icon}
              <h2 className="text-2xl font-semibold mt-4">{app.name}</h2>
              <p className="text-gray-600 mt-2">{app.description}</p>
            </CardContent>
          </Card>
        ))}
      </div>

      <h2 className="text-3xl font-bold text-center mt-8">Trading Tips for Beginners</h2>
      <ul className="list-disc list-inside mt-4 text-gray-700">
        {tradingTips.map((tip, index) => (
          <li key={index} className="mb-2">{tip}</li>
        ))}
      </ul>

      <h2 className="text-3xl font-bold text-center mt-8">Stock Market Basics</h2>
      <ul className="list-disc list-inside mt-4 text-gray-700">
        {stockMarketBasics.map((basic, index) => (
          <li key={index} className="mb-2">{basic}</li>
        ))}
      </ul>

      <h2 className="text-3xl font-bold text-center mt-8">FAQ</h2>
      <div className="mt-4">
        {faqs.map((faq, index) => (
          <div key={index} className="p-4 border-b cursor-pointer" onClick={() => setActiveFaq(activeFaq === index ? null : index)}>
            <h3 className="text-xl font-semibold">{faq.question}</h3>
            {activeFaq === index && <p className="text-gray-600 mt-2">{faq.answer}</p>}
          </div>
        ))}
      </div>
    </div>
  );
};

export default Apps;
